import axios from "axios";

export class CustomerService{

    baseUrl = "http://localhost:8080/api/v1/customer/"

    async getCustomer(email){
        const res = await axios.get(this.baseUrl+"search/" + email).then( res => res.data);
        return res;
    }

    postCustomer(customer){
        return axios.post(this.baseUrl + "/create", customer).then(res => res.data);
    }
}
